import React, { useState } from 'react';
import Square from "./square"
import Lawn from "./lawn"

class BimBamJob extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      history: [{
        squares: Array(9).fill(null)
      }],
      xIsNext: true
    };
  }

   render() {
	   return (
      <div className="game">
        <div className="game-board">
	   	 <span>Size {this.props.size} </span>
       <Lawn size= {this.props.size} />
       </div>
      </div>
	   )
	}
}

export default BimBamJob
